import React from "react";
import { UserCircleIcon } from "@heroicons/react/solid";

const Header = () => {
    return (
        <div>
            <div
                style={{
                    backgroundColor: "#F5F5F5",
                    borderBottom: "solid #B2B2B2 1px",
                }}
                className="grid grid-cols-1 justify-items-center py-2  w-screen"
            >
                <UserCircleIcon className="h-12 w-12" />
                <p className="text-center">Lucas Zhu ></p>
            </div>
        </div>
    );
};

export default Header;
